    i := g_max * v * (-1.0 + exp((v - v_eq) * FoRT * /*Real*/(ion_z))) / (-1.0 + exp(v * FoRT * /*Real*/(ion_z)));
  end if;
end InaMo.Components.Functions.ghkFlux;

